import React from 'react';

export default function Home() {
  return (
    <main className="hero">
      <div className="hero__content">
        <h1>Tired of wasting money & energy?</h1>
        <p>See how much you can save with our devices!</p>
        <button>Get started</button>
      </div>
    </main>
  );
}
